import React, { useState } from 'react';
import clsx from 'clsx';
import PerfectScrollbar from 'react-perfect-scrollbar';
import { withStyles } from '@material-ui/styles';
import {
    Card,
    CardActions,
    CardContent,
    Avatar,
    Checkbox,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    Typography,
    TablePagination
} from '@material-ui/core';
import moment from 'moment';
import { getInitials } from 'helpers';
//import { ToolbarTable } from './components';
import styles from './styles';

const PresencesTable = props => {
    const { className, classes } = props;
    const [selectedUsers, setSelectedUsers] = useState([]);
    const [rowsPerPage, setRowsPerPage] = useState(5);
    const [page, setPage] = useState(0);

    const handleSelectAll = event => {
        // let selectedUsers;
        // if (event.target.checked) {
        //     selectedUsers = users.map(user => user._id);
        // } else {
        //     selectedUsers = [];
        // }
        // setSelectedUsers(selectedUsers);
    };
    const handleSelectOne = (event, id) => {
        // const selectedIndex = selectedUsers.indexOf(id);
        // let newSelectedUsers = [];
        // if (selectedIndex === -1) {
        //     newSelectedUsers = newSelectedUsers.concat(selectedUsers, id);
        // } else if (selectedIndex === 0) {
        //     newSelectedUsers = newSelectedUsers.concat(selectedUsers.slice(1));
        // } else if (selectedIndex === selectedUsers.length - 1) {
        //     newSelectedUsers = newSelectedUsers.concat(
        //         selectedUsers.slice(0, -1)
        //     );
        // } else if (selectedIndex > 0) {
        //     newSelectedUsers = newSelectedUsers.concat(
        //         selectedUsers.slice(0, selectedIndex),
        //         selectedUsers.slice(selectedIndex + 1)
        //     );
        // }
        // setSelectedUsers(newSelectedUsers);
    };
    const handlePageChange = (event, page) => {
        setPage(page);
    };
    const handleRowsPerPageChange = event => {
        setRowsPerPage(+event.target.value);
        setPage(0);
    };

    return (
        <Card className={clsx(classes.root, className)}>
            {/* <ToolbarTable
                selectedUsers={selectedUsers}
                deleteUsers={deleteUsers}
            /> */}
            <CardContent className={classes.content}>
                <PerfectScrollbar>
                    <div className={classes.inner}>
                        <Table>
                            <TableHead>
                                <TableRow>
                                    <TableCell padding="checkbox" style={{borderRight: '1 px solid'}}>
                                        <Checkbox
                                            // checked={
                                            //     selectedUsers.length ===
                                            //     users.length
                                            // }
                                            color="primary"
                                            // indeterminate={
                                            //     selectedUsers.length > 0 &&
                                            //     selectedUsers.length <
                                            //         users.length
                                            // }
                                            onChange={handleSelectAll}
                                        />
                                    </TableCell>
                                    <TableCell>mssv</TableCell>
                                    <TableCell>ten</TableCell>
                                    <TableCell>ngay sinh</TableCell>
                                    <TableCell>gioitinh</TableCell>
                                    <TableCell colSpan={3} align='center'>ngay kiem dien</TableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                                <TableRow
                                    className={classes.tableRow}
                                    hover
                                    // selected={
                                    //     selectedUsers.indexOf(
                                    //         user._id
                                    //     ) !== -1
                                    // }
                                >
                                    <TableCell padding="checkbox">
                                        <Checkbox
                                            // checked={
                                            //     selectedUsers.indexOf(
                                            //         user._id
                                            //     ) !== -1
                                            // }
                                            color="primary"
                                            // onChange={event =>
                                            //     handleSelectOne(event, user._id)
                                            // }
                                            value="true"
                                        />
                                    </TableCell>
                                    <TableCell>
                                        <Typography variant="body1">
                                            nguyen duc ao
                                        </Typography>
                                    </TableCell>
                                    <TableCell>aonguyen@gmail.com</TableCell>
                                    <TableCell>0909092121</TableCell>
                                    <TableCell>nam</TableCell>
                                    <TableCell>12/12/2019</TableCell>
                                    <TableCell>12/12/2019</TableCell>
                                    <TableCell>12/12/2019</TableCell>
                                </TableRow>
                                <TableRow
                                    className={classes.tableRow}
                                    hover
                                    // selected={
                                    //     selectedUsers.indexOf(
                                    //         user._id
                                    //     ) !== -1
                                    // }
                                >
                                    <TableCell padding="checkbox">
                                        <Checkbox
                                            // checked={
                                            //     selectedUsers.indexOf(
                                            //         user._id
                                            //     ) !== -1
                                            // }
                                            color="primary"
                                            // onChange={event =>
                                            //     handleSelectOne(event, user._id)
                                            // }
                                            value="true"
                                        />
                                    </TableCell>
                                    <TableCell>
                                        <Typography variant="body1">
                                            nguyen duc ao
                                        </Typography>
                                    </TableCell>
                                    <TableCell>aonguyen@gmail.com</TableCell>
                                    <TableCell>0909092121</TableCell>
                                    <TableCell>nam</TableCell>
                                    <TableCell>12/12/2019</TableCell>
                                    <TableCell>12/12/2019</TableCell>
                                    <TableCell>12/12/2019</TableCell>
                                </TableRow>
                            </TableBody>
                        </Table>
                    </div>
                </PerfectScrollbar>
            </CardContent>
            <CardActions className={classes.actions}>
                <TablePagination
                    component="div"
                    count={2}
                    onChangePage={handlePageChange}
                    onChangeRowsPerPage={handleRowsPerPageChange}
                    page={page}
                    rowsPerPage={rowsPerPage}
                    rowsPerPageOptions={[]}
                    backIconButtonProps={{
                        'aria-label': 'previous page'
                    }}
                    nextIconButtonProps={{
                        'aria-label': 'next page'
                    }}
                    labelRowsPerPage=""
                />
            </CardActions>
        </Card>
    );
};
export default withStyles(styles)(PresencesTable);
